 Soccer ManagerHomePrivacy PolicyPrivacy and Data PolicySoccer Manager will only use information collected about you in accordance with the Data Protection Act 1998.Soccer Manager may ask you for certain information and you may submit personal data to the Web Site (such as your name, email address and contact details) when you subscribe or sign up to the Web Site.Soccer Manager may also record which parts of the Web Site and services you are interested in as well as user traffic patterns and site use. This information will be kept securely in accordance with an internal security policy and may be used:process your Communications, your subscription to the Web Site and to enable your use of the Web Site and associated services;open and run your account and provide you with an up to date, efficient and reliable service;administer prize draws;generally run the Web SiteGoogle and the DoubleClick DART cookie:Google, as a third-party vendor, uses cookies to serve ads on this site.Google's use of the DART cookie enables it to serve ads to users based on their visit to this site and other sites on the Internet.Users may opt out of the use of the DART cookie by visiting the Google ad and content network privacy policy.We use third-party advertising companies to serve ads when you visit our website.These companies may use information (not including your name, address, email address or telephone number) about your visits to this and other websites in order to provide advertisements about goods and services of interest to you.If you would like more information about this practice and would like to know your options in relation to not having this information used by these companies, Please visit the Network Advertising Initiative website.By subscribing and submitting your data you agree to this use.From time to time Soccer Manager also monitor and record telephone calls for training purposes and to improve the service to you.Soccer Manager will never collect sensitive information about you without your explicit consent.In accordance with the Data Protection Act 1998, Soccer Manager is registered with the Information Commissioner Z1222362.If you believe Soccer Manager has information about you that you do not want Soccer Manager to have or that is incorrect or please contact Soccer Manager as described below and Soccer Manager shall correct or remove the data as you request as soon a reasonably practicable.If you have any other concerns over privacy, this privacy policy or this Web Site please contact Soccer Manager as described below.Marketing CommunicationsSoccer Manager gives you a choice whether or not you want Soccer Manager or other reputable companies to contact you about future offers, events and new services or related activities that you may find useful. Soccer Manager won't sell or trade personal information to other companies but Soccer Manager would like to keep you informed of the developments on the Web Site and certain Games and Soccer Manager would like to share data with other reputable companies who may have interesting offers and information for you (inside or outside the EU).Soccer Manager will not send you any marketing emails or pass your information on to third parties unless you give your consent or you have given it already.CookiesSoccer Manager uses 'cookies' on the Web Site. Cookies are a way that information such as whether you have visited the Web Site before is recorded on your computer and used by Soccer Manager to improve the Web Site and the services available to you. If you do not wish for Soccer Manager to use cookies when you use the Web Site please adjust your Internet browser settings to not accept cookies. Your computer's help file should tell you how to do this but please note that this may affect your ability to use the Web Site and Games.If you don't disable "cookies" the Web Site will ask for and store details including name and email address and may automatically insert certain information on the 